import React, { useState } from 'react';
import './Contact.css';
import logo from './logo.png'; 

function Contact() {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: '',
  });

  const handleChange = (event) => {
    const { name, value } = event.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    
    console.log('Form submitted:', formData);
  };

  return (
    <div className="contact-page">
      <header className="contact-header">
      <div className="logo-container">
      <img src={logo} alt="Hotel Reservations App" className="home-logo" />
      </div>
      <br></br><br></br><br></br><br></br><br></br><br></br><br></br><br></br>
        <h1>Contact Us</h1>
      </header>
      <main className="contact-main">
        <section className="contact-info">
        <h2>Get in Touch</h2>
      <p>If you have any questions, feel free to reach out to us using the form below or contact us directly.</p>
      <ul>
        <li>
          <span className="contact-icon">üìû</span> +1 234 567 890
        </li>
        <li>
          <span className="contact-icon">‚úâÔ∏è</span> info@example.com
        </li>
        <li>
          <span className="contact-icon">üìç</span> 123 Main Street, Anytown, USA
        </li>
      </ul>
        </section>

        
        <section className="contact-form">
          <h2>Send Us a Message</h2>
          <form onSubmit={handleSubmit}>
            <label htmlFor="name">Name</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.name}
              onChange={handleChange}
              required
            />
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              required
            />
            <label htmlFor="message">Message</label>
            <textarea
              id="message"
              name="message"
              value={formData.message}
              onChange={handleChange}
              required
            ></textarea>
            <button type="submit">Send Message</button>
          </form>
        </section>
      </main>


      <footer className="about-footer">
        <p>&copy; 2024 CheckInn. All rights reserved.</p>
        <p>Website by <a href="#">Anja Stevkovska</a></p>
      </footer>
    </div>
  );
}

export default Contact;
